import Card from "./Card";
import contacts from "./contacts";

function App() {

  console.log(contacts);

  return (
    <div className="container">
      <div className="titleAPP">
        <h1>My contats</h1>
      </div>
      <Card
        name={contacts[0].name}
        img="https://f.i.uol.com.br/fotografia/2022/06/20/165573915462b0931254df2_1655739154_3x2_md.jpg"
        tel="119877117"
        email="beyonce@c.com"
      />

      <Card
        name="Chuck Norris"
        img="https://img.estadao.com.br/resources/jpg/8/3/1489168579338.jpg"
        tel="115555565"
        email="chuckmaster@norris.com"
      />
      <Card
        name="Jack Bauer"
        img="https://upload.wikimedia.org/wikipedia/en/b/b9/Jack_Bauer.jpg"
        tel="112458658"
        email="jack@bauer123.com"
      />
    </div>
  );
}

export default App;
